import React from 'react';
import './Header.css';
import myicon from './image/myicon.png';
import top_img from './image/top.png';
import github_icon from './image/github-logo_icon.png';

class Header extends React.Component {
  render() {
    return (
      <div className='header'>
        <div className='header-logo'> 
          <img src = {top_img}/>
        </div>
        <div className='header-right'>
            <a href = "https://github.com/yugaro" className = "btn btn-head2"><img src = {github_icon}/></a>
            <a href = "https://www.yahoo.co.jp/" className = "btn btn-head2"> <img src = {github_icon}/></a>
            <a href = "https://www.yahoo.co.jp/" className = "btn btn-head2"> <img src = {github_icon}/></a>
        </div>
      </div>
    );
  }
}

export default Header;
